import React, {useState}from "react";
import { ThemeProvider } from '@material-ui/core/styles'
import CssBaseline from '@material-ui/core/CssBaseline'
import theme from '../../theme'
import { makeStyles } from '@material-ui/core/styles';
import Item from '../../components/item'
import { Button, CardContent, CardActionArea,
    Card, Grid, Paper, TextField, Typography 
} from '@material-ui/core';


const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
    },

    card: {
        maxWidth: 345,
    },
    media: {
        height: 0,
        paddingTop: '56.25%', // 16:9
    },
}));
export default function login() {
    function Login() {
        const [password, setPassword] = useState({})

    function handleInputChange(event) {
        const { name, value } = event.target;
        setPassword({...password, [name]: value})
    };

    function handleFormSubmit(event) {
        event.preventDefault();
        if (password.username && password.password) {
            console.log("soop")
        }
    };

    const classes = useStyles();
    return(
        <ThemeProvider theme={theme}>
            <CssBaseline />
            <Item />
            <div className={classes.root}>
                <Grid container spacing={3}>
                    <Grid item xs={10}>
                        <Card color="secondary">
                            <CardContent id="login">
                                <Paper className={classes.paper}>
                                    <Typography gutterBottom variant="h3" component="h2">
                                        Login
                                        <h5>username</h5>
                                        <input 
                                            onChange={handleInputChange}
                                            name="username"
                                        />
                                        <br/>
                                        password
                                        <input
                                            onChange={handleInputChange}
                                            name="password"/>
                                            <br/>
                                            <Button
                                            disabled={!(password.username && password.password)}
                                            onClick={handleFormSubmit}>Submit
                                            </Button>
                                        )
                                    </Typography>
                                </Paper>
                            </CardContent>
                        </Card>
                    </Grid>
                </Grid>
            </div>
        </ThemeProvider>

    )
};

}
